void MagnetometetNetworkFloat::forward()
{
	Conv1d<512, 4, 16, 3, 2, float, float, float, 1, 1>(
		output_buffer(), input_buffer(), 
		MagnetometetNetworkFloat_layer_0_weights, MagnetometetNetworkFloat_layer_0_bias, 128);
	swap_buffer();

	ReLU<float>(	output_buffer(), input_buffer(), 4096);
	swap_buffer();

	Conv1d<256, 16, 16, 3, 2, float, float, float, 1, 1>(
		output_buffer(), input_buffer(), 
		MagnetometetNetworkFloat_layer_3_weights, MagnetometetNetworkFloat_layer_3_bias, 128);
	swap_buffer();

	ReLU<float>(	output_buffer(), input_buffer(), 2048);
	swap_buffer();

	Conv1d<128, 16, 32, 3, 2, float, float, float, 1, 1>(
		output_buffer(), input_buffer(), 
		MagnetometetNetworkFloat_layer_6_weights, MagnetometetNetworkFloat_layer_6_bias, 128);
	swap_buffer();

	ReLU<float>(	output_buffer(), input_buffer(), 2048);
	swap_buffer();

	Conv1d<64, 32, 32, 3, 2, float, float, float, 1, 1>(
		output_buffer(), input_buffer(), 
		MagnetometetNetworkFloat_layer_9_weights, MagnetometetNetworkFloat_layer_9_bias, 128);
	swap_buffer();

	ReLU<float>(	output_buffer(), input_buffer(), 1024);
	swap_buffer();

	Conv1d<32, 32, 64, 3, 2, float, float, float, 1, 1>(
		output_buffer(), input_buffer(), 
		MagnetometetNetworkFloat_layer_12_weights, MagnetometetNetworkFloat_layer_12_bias, 128);
	swap_buffer();

	ReLU<float>(	output_buffer(), input_buffer(), 1024);
	swap_buffer();

	Conv1d<16, 64, 128, 3, 2, float, float, float, 1, 1>(
		output_buffer(), input_buffer(), 
		MagnetometetNetworkFloat_layer_15_weights, MagnetometetNetworkFloat_layer_15_bias, 128);
	swap_buffer();

	ReLU<float>(	output_buffer(), input_buffer(), 1024);
	swap_buffer();

	Conv1d<8, 128, 4, 1, 1, float, float, float, 1, 1>(
		output_buffer(), input_buffer(), 
		MagnetometetNetworkFloat_layer_18_weights, MagnetometetNetworkFloat_layer_18_bias, 128);
	swap_buffer();

	GlobalAveragePooling1d<1, 8, 4, float, float, 1>(
		output_buffer(), input_buffer());
	swap_buffer();

	swap_buffer();
}
